import React from "react";

function CheckBox(props) {
  return (
    <div className="TEXT">
      <div>
        Я согласен {" "}
      </div>
      <div className="CHECKBOX">
        <input type="INPUTPM" checked={props.checked} onChange={props.onChange}/>{" "}
      </div>
      <div>
        Принимать актуальную информацию на емейл
      </div>
    </div>
  )
}

export default CheckBox
